export const styles = theme => ({
    root: {},
    hotel: { color: `${theme.palette.spot.main} !important` },
    package: { color: `${theme.palette.package.main} !important` },
    oldPrice: {
        textDecoration: "line-through",
        "&.price_hotel": {
            textDecorationColor: `${theme.palette.spot.main}`
        },
        "&.price_package": {
            textDecorationColor: `${theme.palette.package.main}`
        }
    }
});
